import React, {Component} from 'react';
import { connect } from 'react-redux';

class Test extends Component {
  render(){
    return(
      <div>
        <button style={this.style} onClick={this.reset}>Reset</button>
      </div>
    )
  }
}
Test = connect((state) => state)(Test);
export default Test;
